import React, { createContext } from "react";
import Dialog from '../dialog/dialog'
import Card from '../../components/Card/Card';

const defaultData = {
  contacts: [
    {
      id: 'ryan',
      name: 'Ryan Florence',
      email: 'ryan@reacttraining.com',
      avatarURL: "data:image/jpeg;base64,"
    },
    {
      id: 'michael',
      name: 'Michael Jackson',
      email: 'michael@reacttraining.com',
      avatarURL: "data:image/jpeg;base64,"
    },
    {
      id: 'tyler',
      name: 'Tyler McGinnis',
      email: 'tyler@reacttraining.com',
      avatarURL: "data:image/jpeg;base64,"
    },
  ]
}

export const itemContext = createContext();
export default function Cards() {
  const [state, setState] = React.useState({
    open: false,
    item: {}
  });

  const openDialog = (item) => {

    setState({
      open: true,
      item: item
    });
  };

  const closeDialog = () => {
    setState({
      open: false,
      item: {}
    });
  };
  const cardElements = defaultData.contacts.map(item => <Card key={item.id} item={item} open={openDialog} />)
  return (
    <>
      {cardElements}
      <itemContext.Provider value={{ item: state.item }}>
        <Dialog open={state.open} close={closeDialog} />
      </itemContext.Provider>
    </>

  );

}